export const DisplayList = ({start,size,facts}) =>{
    let loc_start = start

    if (loc_start < 0){
        loc_start = 0
    }
    const formattedFacts = facts.slice(loc_start,loc_start+size).map(fact => 
            (<li key= {facts.indexOf(fact)} data-index={facts.indexOf(fact)}>{facts.indexOf(fact)}<br/>{fact}</li>)
        );


    //console.log(formattedFacts)size={Size} facts = {locFacts} start = {startPage}
    return (
        <ul>
            {loc_start}-{start+size-1}
            {formattedFacts}
        </ul>
    )
}
